import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import html from "./images/html-5.svg";
import css from "./images/css-3.svg";
import javascript from "./images/javascript-4.svg";
import bootstrap from "./images/bootstrap-4.svg";
import sass from "./images/sass.svg";
import npm from "./images/npm.svg";
import node from "./images/nodejs.svg";
import mongodb from "./images/mongodb.svg";
import {Container} from 'react-bootstrap';

class Home extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Container>
        <div className="col-lg-8 col-lg-offset-2 col-md-8 col-md-offset-2 col-sm-12">
          <div className="title">
            <h1>Stephen Doyle</h1>
            <h1>Developer</h1>
          </div>
          <div className="images">
            <img className="logo" src={html} alt="HTML5" />
            <img className="logo" src={css} alt="CSS3" />
            <img className="logo" src={javascript} alt="JavaScript" />
            <img className="logo" src={bootstrap} alt="Bootstrap" />
            <img className="logo" src={sass} alt="Sass" />
            <img className="logo" src={npm} alt="NPM" />
            <img className="logo" src={node} alt="Node.js" />
            <img className="logo" src={mongodb} alt="MongoDB" />
          </div>
        </div>
      </Container>
    );
  }
}

export default Home;
